import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Documents.css';

function Documents() {
  const [documents, setDocuments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user'));

  const fetchDocuments = useCallback(async () => {
    try {
      console.log('Отправка запроса документов:', { userId: user.id, role: user.role });
      const response = await axios.get(`http://192.168.0.102:5000/api/documents`, {
        params: {
          userId: user.id,
          role: user.role
        }
      });
      console.log('Получены документы:', response.data);
      response.data.forEach((doc, index) => {
        console.log(`Документ ${index + 1}:`, {
            regnumber: doc.regnumber,
            formseries: doc.formseries,
            formnumber: doc.formnumber
        });
      });
      setDocuments(response.data);
      setLoading(false);
    } catch (err) {
      console.error('Ошибка при загрузке документов:', err);
      setError(err.response?.data?.error || 'Ошибка при загрузке документов');
      setLoading(false);
    }
  }, [user.id, user.role]);

  useEffect(() => {
    fetchDocuments();
  }, [fetchDocuments]);

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  const handleBack = () => {
    navigate(user.role === 1 ? '/admin' : '/user');
  };

  if (loading) return <div className="loading">Загрузка...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="documents-container">
      <div className="documents-header">
        <h1>{user.role === 1 ? 'Все документы' : 'Мои документы'}</h1>
        <div className="header-buttons">
          <button onClick={handleBack} className="back-button">Назад</button>
          <button onClick={handleLogout} className="logout-button">Выйти</button>
        </div>
      </div>

      <div className="documents-list">
        {documents.length === 0 ? (
          <p className="no-documents">Документы не найдены</p>
        ) : (
          <table className="documents-table">
            <thead>
              <tr>
                {user.role === 1 && <th>Сотрудник</th>}
                <th>Программа</th>
                <th>Регистрационный номер</th>
                <th>Серия формы</th>
                <th>Номер формы</th>
                <th>Дата выдачи</th>
                <th>Дата начала</th>
                <th>Дата окончания</th>
              </tr>
            </thead>
            <tbody>
              {documents.map((doc) => (
                <tr key={doc.ID_Document}>
                    {user.role === 1 && <td>{doc.WorkerName}</td>}
                    <td>{doc.ProgramName}</td>
                    <td>{doc.regnumber}</td>
                    <td>{doc.formseries}</td>
                    <td>{doc.formnumber}</td>
                    <td>{new Date(doc.DateIssue).toLocaleDateString()}</td>
                    <td>{new Date(doc.DataStart).toLocaleDateString()}</td>
                    <td>{new Date(doc.DataEnd).toLocaleDateString()}</td>

                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default Documents;
